    const data = [
        {
            title: 'Manger',
            task: "Mange du gateau"
        },
        {
            title: 'Manger',
            task: "Mange du gateau"
        }
    ]
    const [todos, setTodos] = useState(data)


    return (
        <div>
            <TodoEditor />
            <TodoList todos={todos} />
        </div>
    )
}

export default App
